   var ss = s.split(v);
   var c = ss.length;
   for(var i = 0; i < c; i++){
      var ln = ss[i];
      if(ln.length){
         var sb = ln.split(n);
         if(sb.length == 2){
            o.set(RString.trim(sb[0]), RString.trim(sb[1]));
         }else{
            o.set(RString.trim(ln), '');
         }
      }
   }
